import React, {useState} from 'react'

export const Checkbox = React.forwardRef(({ onClick, isSelected, rowData, rowClickCounts, setRowClickCounts, ...rest }, ref) => {
  const handleClick = (event) => {
    setRowClickCounts(prevCounts => {
      
      prevCounts[rowData] = (prevCounts[rowData] || 0) + 1;
      return prevCounts;
    });
    onClick(event);
  };

  const clickCount = rowClickCounts[rowData] || 0;

  return (
    <>
      <button
        ref={ref}
        onClick={handleClick}
        {...rest}
        className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded"
      >
        Select ({rowClickCounts[rowData]})
      </button>
    </>
  );
});
